when=function(i){var a=new Date().getTime();var d=new Date(i*1000).getTime();if(a<d){return""}var e=60*1000;var g=e*60;var f=g*24;var c=f*30;var b=f*365;var h=a-d;if(h<e){return Math.round(h/1000)+"min"}else{if(h<g){return Math.round(h/e)+"min"}else{if(h<f){return Math.round(h/g)+"h"}else{if(h<c){return Math.round(h/f)+"d"}else{if(h<b){return Math.round(h/c)+"meses"}else{return Math.round(h/b)+"anos"}}}}}throw"time conversion error"};